Este poema es un soneto de Antonio Machado, poeta español de la Generación del 98, que vivió entre finales del siglo XIX y principios del siglo XX (1875-1939). El poema refleja su estilo de describir una vida sencilla y austrera, con un tono autobiográfico característico de su obra.
